import React from "react";
import { Link } from "react-router-dom";
import './Footer.css';
const Footer=({phrase,link,linkaddress})=>{
    return(
    <div className="footer-link">
        {phrase}
        <link to={linkaddress}  className="footer-link-element">
        {link}
        </link>
    </div>
    );
};
export default Footer;
